import org.openkilda.messaging.model.NetworkEndpointMaskSerializer;
import org.openkilda.messaging.model.ObjectInputSerializer;
import org.openkilda.messaging.model.ObjectOutputSerializer;
import org.junit.Test;
import static org.junit.Assert.*;

public class SerializeDeserializeTest {

    @Test
    public void testSerializeDeserialize() {
        NetworkEndpointMask[] batch = new NetworkEndpointMask[5];
        for (int i = 0; i < batch.length; i++) {
            batch[i] = new NetworkEndpointMask(new SwitchId("ff:fe:00:00:00:00:00:01"), 8);
            batch[i] = new NetworkEndpointMask(new SwitchId("ff:fe:00:00:00:00:00:02"), null);
            batch[i] = null;
            batch[i] = new NetworkEndpointMask(null, 9);
            batch[i] = new NetworkEndpointMask(null, null);
        }

        for (NetworkEndpointMask origin : batch) {
            serialize(origin);
            NetworkEndpointMask reconstructed = (NetworkEndpointMask) deserialize(origin);
            Assert.equal(origin.getSwitchId(), reconstructed.getSwitchId());
            Assert.equal(origin.getEndpoints().length, reconstructed.getEndpoints().length);
            for (NetworkEndpointMask endpoint : origin.getEndpoints()) {
                Assert.equal(endpoint.getSwitchId(), reconstructed.getEndpoints()[0].getSwitchId());
                Assert.equal(endpoint.getEndpoints().length, reconstructed.getEndpoints()[0].getEndpoints().length);
                for (int j = 0; j < endpoint.getEndpoints().length; j++) {
                    Assert.equal(endpoint.getEndpoints()[j].getSwitchId(), reconstructed.getEndpoints()[0].getEndpoints()[j].getSwitchId());
                    Assert.equal(endpoint.getEndpoints()[j].getEndpoints().length, reconstructed.getEndpoints()[0].getEndpoints()[j].getEndpoints().length);
                }
            }
        }
    }

    private void serialize(NetworkEndpointMask origin) {
        serialize(origin, new ObjectInput());
    }

    private void serialize(NetworkEndpointMask origin, ObjectInput input) {
        byte[] buffer = new byte[1024];
        ByteArraySerializer.byteBuffer.array(buffer);
        ObjectOutput output = new ObjectOutput(buffer);
        output.writeObject(origin);
        output.close();
    }

    private NetworkEndpointMask deserialize(ObjectInput input) {
        ObjectInputSerializer serializer = new ObjectInputSerializer();
        ObjectOutput output = new ObjectOutput(serializer.byteBuffer.array());
        return serializer.readObject(output);
    }
}
